import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
fetch("http://localhost:8000/item/delete/1").then((response)=>{
  console.log(response);
})

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
